import './App.css';

const AdminPage1 = () => {
    return (
        <div className='Appxs'>
            <AppHeader />
            <div style={{ display: 'flex' }}>
                <Space>
                <SideMenu />
                <PageContent />

                </Space>

            </div>
            <AppFooter />
        </div>
    );
};

export default AdminPage1;
